import {useState} from 'react'

const ToDoCreate = () => {
    const [todo, setTodo] = useState('')

    const handleChange = (event) => {
        setTodo(event.target.value)
    }
    return(
        <form>
            <label>Title:</label>
            <input type="text" onChange={handleChange} value={todo}/>
        </form>
    )
}

export default ToDoCreate
